sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  var pdfDoc = new sn_pdfgeneratorutils.PDFGenerationAPI;
  var result = pdfDoc.getDocumentFields(inputs.attachment);
  var fieldType = pdfDoc.getDocumentFieldsType(inputs.attachment);
  var resultArray = [];
  if (fieldType.status == 'success') {
    var propertyArray = Object.getOwnPropertyNames(fieldType.fields_type);
    for (var j=0; j<propertyArray.length;j++) {
      var fieldName = propertyArray[j].toString();
      var lineFieldType = fieldType.fields_type[fieldName].type.toString();
     if (lineFieldType != 'radio_button') {
      var lineObj = {
        "field_name" : fieldName,
        "field_type" : lineFieldType
        }
      resultArray.push(lineObj);
      }
      if (lineFieldType == 'radio_button') {
        var radioOptions = JSON.stringify(fieldType.fields_type[fieldName].fieldsDetails);
        var radioOptionsJSON = radioOptions.substring(2,radioOptions.length-2);
        var radioOptionsArray = radioOptionsJSON.split('},{');
        var optionsArray = [];
        for (k=0;k<radioOptionsArray.length;k++)
        {
          var lineParse = "{" + radioOptionsArray[k] + "}";
          var radioOptionObj = JSON.parse("{" + radioOptionsArray[k] + "}");

          optionsArray.push(radioOptionObj.fieldName);
        }
        var arrayLine = "[" + optionsArray.join(",") + "]";
        var lineObj = {
          "field_name" : fieldName,
          "field_type" : lineFieldType,
          "field_options" : arrayLine
        }
        resultArray.push(lineObj);
      }
  }

   outputs.fields = result.fields;
   outputs.fields_object_array = resultArray;
}
  outputs.status = fieldType.status;



})(inputs, outputs);

